import React from 'react'

export const IndividualProduct = ({ individualProduct }) => {
    return (
        <div className='product'>
            <div className='product-img'>
                <img src={individualProduct.url} alt="product-img" />
            </div>
            <div className='product-text title'>title {individualProduct.title}</div>
            <div className='product-text description'>desc{individualProduct.description}</div>
            <div className='product-text price'>price$ {individualProduct.price}</div>
            <div className="product-text date">
                {individualProduct.date !== 0 ? (
                    <span className="product-sold-out"> date{individualProduct.date}</span>
                ) : (
                    <span className="product-remaining"></span>
                )}
            </div>
            <div className=''></div>
            <div className="half">
                {individualProduct.date !== 0 ? (
                    <span className="product-sold-out"> cost with{individualProduct.price - (individualProduct.price / 100 * individualProduct.sell)}</span>
                ) : (
                    <span className="product-remaining"></span>
                )}
            </div>
            <div className='btn btn-danger btn-md cart-btn'  >ADD TO CART</div>
        </div>
    )
}
